import React from 'react'
import AppBar from '@material-ui/core/AppBar'
import { withStyles } from '@material-ui/core/styles'

const styles = {
    socialLink: {
        textDecorationStyle: 'red'
    }
}

function TopBar(props)
{
    console.log(styles)
    return(
        <AppBar 
        position="sticky"
        color="primary">
            <h1 id="headerTitle">{props.name}</h1>
            <ol id="socialLinks">
                {Object.keys(props.social).map(item => {
                    return <li key={item} className="socialLink" style={styles.socialLink}><a href={props.social[item]}>{item}</a></li>
                })}
            </ol>
        </AppBar>
    )
}

export default withStyles(styles)(TopBar)
